import React, {Component} from 'react'
import Panelbox from './Panelbox'

class Detail extends Component{
    navigateToList = () =>{
        this.props.history.push("/products");
    }
    render(){

        const content =
            <div>
                <table>
                    <thead>
                    <th>
                        <th>Product Name</th>
                        <th>Product Code</th>
                        <th>Price</th>
                        <th>Release</th>
                        <th>Rating</th>
                    </th>
                    </thead>
                    <tbody>
                     <td>
                         {JSON.stringify(this.props.match.params.productName)}
                     </td>
                     <td>
                         {JSON.stringify(this.props.match.params.productCode)}
                     </td>
                     <td>
                         {JSON.stringify(this.props.match.params.price)}
                     </td>
                     <td>
                         {JSON.stringify(this.props.match.params.releaseDate)}
                     </td>
                     <td>
                         {JSON.stringify(this.props.match.params.starRating)}
                     </td>

                    </tbody>
                </table>
                {JSON.stringify(this.props.match.params.productCode)}<br/>
                <button className="btn btn-warning" onClick={this.navigateToList}>Back to List</button>
            </div>

        return <Panelbox heading="Product Details" content={content}/>
    }
}

export default Detail;
